import React, { Component } from 'react';
import './colleges.css';
import Data from '../Data.json';

export default class Colleges extends Component {
	constructor() {
		super();
		this.state = {
			CollagesList: [],
		};
	}
	render() {
		let Colleges = Data.colleges;
		// console.log(Colleges, 'check the list of data');

		return (
			<>
				<div className='container'>
					{Colleges.forEach((value) => {
						console.log(value.college_name);
						return (
							<div>
								<p>{value.college_name}</p>;
							</div>
						);
					})}
				</div>
			</>
		);
	}
}
